export class Article {
    constructor(title, description, auctionId, estimation, initialOffering, photoPath ) {
        this.title = title
        this.description = description
        this.auctionId = auctionId
        this.estimation = estimation
        this.initialOffering = initialOffering
        this.photoPath = photoPath
    }
}
